import React from 'react';
import '../../public/styles/index.css'; // Ajuste o caminho conforme necessário

function SlideNavbar() {
  const handleFormSubmit = (event) => {
    event.preventDefault(); // Evita o comportamento padrão de enviar o formulário com o método GET.

    // Captura os dados do formulário
    const formData = new FormData(event.target);
    const data = {
      txt: formData.get('txt'),
      email: formData.get('email'),
      pswd: formData.get('pswd'),
    };

    // Aqui você pode fazer algo com os dados, como enviar para um servidor ou processar internamente.
    console.log(data);
  };

  return (
    <div className="main">
      <input type="checkbox" id="chk" aria-hidden="true" />

      <div className="signup">
        <form onSubmit={handleFormSubmit}>
          <label htmlFor="chk" aria-hidden="true">Sign Up</label>
          <input type="text" name="txt" placeholder="Username" required />
          <input type="email" name="email" placeholder="Email" required />
          <input type="password" name="pswd" placeholder="Password" required />
          <button type="submit">Sign Up</button>
        </form>
      </div>

      <div className="login">
        <form onSubmit={handleFormSubmit}>
          <label htmlFor="chk" aria-hidden="true">Login</label>
          <input type="email" name="email" placeholder="Email" required />
          <input type="password" name="pswd" placeholder="Password" required />
          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
}

export default SlideNavbar;
